import React from "react";
import { BrowserRouter, Route } from "react-router-dom";
import Navbar from "./Components/Layout/Navbar";
import dashboard from "./Components/Dashboard/dashboard";

function App() {
  return (
    <BrowserRouter>
      <Navbar />
      <Route path="/" component={dashboard} />
      Notification
    </BrowserRouter>
  );
}

export default App;
